<html lang="en">

    <style>
      * {
        padding: 0;
        margin: 0;
        box-sizing: border-box;
      }
      body {
        min-height: 100vh;
        display: flex;
        justify-content: center;
        align-items: center;
        padding: 20px;
      }

      form {
        width: 100%;
        max-width: 400px;
      }

      .logo {
        text-align: center;
        margin-bottom: 20px;
      }

      .logo svg {
        width: 100px;
        height: 100px;
      }

      .image-block {
        text-align: center;
        margin-bottom: 50px;
      }

      .title {
        text-align: center;
        margin-bottom: 40px;
      }

      .title h1 {
        font-family: Inter;
        font-size: 32px;
        font-weight: 700;
        line-height: 38.73px;
        color: #333333;
        margin-bottom: 10px;
      }

      .title p {
        font-family: Inter;
        font-size: 18px;
        font-weight: 500;
        line-height: 21.78px;
        color: #999999;
      }

      .btn-block {
        text-align: center;
        margin-bottom: 20px;
      }

      .btn-block button {
        font-family: Inter;
        font-size: 20px;
        font-weight: 700;
        line-height: 24.2px;
        width: 400px;
        height: 60px;
        border-radius: 8px;
        border: none;
        background-color: #ef5350;
      }

      .btn-block button a {
        color: #ffffff;
        text-decoration: none;
      }

      .already-have {
        text-align: center;
      }

      .already-have p {
        font-family: Inter;
        font-size: 18px;
        font-weight: 500;
        line-height: 21.78px;
        color: #999999;
      }

      .already-have p a {
        color: #ef5350;
        text-decoration: none;
      }
    </style>
  </head>
